import React from 'react';
import {FirstName} from './ComA';

const ComD=()=>{
    return (
        <>
            <h1>Get Data from A-D Context Implementation (Complex Way) </h1>
            <FirstName.Consumer>{(fName)=>{
                return <h2> Get Data from A (My name is {fName})</h2>
            }}</FirstName.Consumer>

        </>
        )
}

export default ComD;
